import React, { useEffect, useState } from 'react';
import axios from 'axios';

import '../css/fastUniHome.css';
import uetLogo from '../../uniHomeImages/uet/uetLogo.png';
import uet1 from '../../uniHomeImages/uet/uet1.jpg';
import uet2 from '../../uniHomeImages/uet/uet2.jpg';
import uet3 from '../../uniHomeImages/uet/uet3.jpg';

import lhr from '../../uniHomeImages/uet/lhr.jpg';
import ksk from '../../uniHomeImages/uet/ksk.jpg';
import nwl from '../../uniHomeImages/uet/nwl.jpg';
import rcet from '../../uniHomeImages/uet/rcet.jpg';
import fsd from '../../uniHomeImages/uet/fsd.jpg';

import adm from '../../uniHomeImages/comsat/adm.jpg';
import eli from '../../uniHomeImages/comsat/eli.jpg';
import fee from '../../uniHomeImages/comsat/fee.jpg';

import Card from './Card';

export default function UetUniPage() {
  // State variables for subject marks
  const [subjectMarks, setSubjectMarks] = useState([]);

  const greenbtn = `btn btn-success`;
  const redbtn = `btn btn-danger`;

  let imgStyle = {
    width: '350px',
    height: '200px',
  };

  useEffect(() => {
    const fetchMarks = async () => {
      try {
        // Fetch marks for each subject
        const chemistryResponse = await fetch('http://localhost:5000/api/ChemistryGraphs/Progress');
        const chemistryData = await chemistryResponse.json();

        const physicsResponse = await fetch('http://localhost:5000/api/PhysicsGraphs/Progress');
        const physicsData = await physicsResponse.json();

        const mathsResponse = await fetch('http://localhost:5000/api/BasicMathsGraphs/Progress');
        const mathsData = await mathsResponse.json();

        const englishResponse = await fetch('http://localhost:5000/api/EnglishGraphs/Progress');
        const englishData = await englishResponse.json();

        const iqResponse = await fetch('http://localhost:5000/api/IQGraphs/Progress');
        const iqData = await iqResponse.json();

        const computerResponse = await fetch('http://localhost:5000/api/ComputerGraphs/Progress');
        const computerData = await computerResponse.json();

        // Store subject marks in the state variable
        setSubjectMarks([
          { subject: 'Chemistry', percentage: chemistryData.percentage },
          { subject: 'Physics', percentage: physicsData.percentage },
          { subject: 'Mathematics', percentage: mathsData.percentage },
          { subject: 'English', percentage: englishData.percentage },
          { subject: 'IQ', percentage: iqData.percentage },
          { subject: 'Computer', percentage: computerData.percentage },
        ]);
      } catch (error) {
        console.error('Error fetching subject marks:', error);
      }
    };

    fetchMarks();
  }, []);

  return (
    <>
      <div className="container-fluid back" style={{ fontFamily: 'MyCustomFont' }}>
        <div className="container pt-4">
          <div className="row">
            <div className="col d-flex justify-content-center">
              <img src={uetLogo} className="img-fluid" alt="" />
            </div>
          </div>
        </div>

        <div className="container pt-4">
          <div className="row justify-content-evenly gy-4">
            <div className="col-auto">
              <img src={uet1} alt="" className="img-fluid" style={imgStyle} />
            </div>
            <div className="col-auto">
              <img src={uet2} alt="" className="img-fluid" style={imgStyle} />
            </div>
            <div className="col-auto">
              <img src={uet3} alt="" className="img-fluid" style={imgStyle} />
            </div>
          </div>
        </div>

        <div className="container pt-4">
          <h2 className="text-center pb-1 borders">UET Campuses</h2>
          <div className="row justify-content-evenly gy-4">
            <div className="col-lg-4">
              <Card title="Lahore Campus" imgSrc={lhr} />
            </div>
            <div className="col-lg-4">
              <Card title="Kala Shah Kaku Campus" imgSrc={ksk} />
            </div>
            <div className="col-lg-4">
              <Card title="Narowal Campus" imgSrc={nwl} />
            </div>
            <div className="col-lg-4">
              <Card title="RCET Campus" imgSrc={rcet} />
            </div>
            <div className="col-lg-4">
              <Card title="Faisalabad Campus" imgSrc={fsd} />
            </div>
          </div>
        </div>

        <div className="container pt-4">
          <h2 className="text-center pb-1 borders">COMSATS Campuses</h2>
          <div className="row justify-content-evenly gy-4">
            <div className="col-lg-4">
              <Card title="Islamabad Campus" imgSrc={adm} />
            </div>
            <div className="col-lg-4">
              <Card title="Lahore Campus" imgSrc={eli} />
            </div>
            <div className="col-lg-4">
              <Card title="FEECE Campus" imgSrc={fee} />
            </div>
          </div>
        </div>

        {subjectMarks.length > 0 && (
          <div className="container my-5">
            <div className="row">
              <div className="col">
                <h2 className="text-center pb-1 borders">Subject Marks</h2>
                <table className="table">
                  <thead>
                    <tr>
                      <th>Subject</th>
                      <th>Percentage</th>
                    </tr>
                  </thead>
                  <tbody>
                    {subjectMarks.map((subject, index) => (
                      <tr key={index}>
                        <td>{subject.subject}</td>
                        <td>{subject.percentage}%</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </div>
          </div>
        )}
      </div>
    </>
  );
}
